import React, { useState } from 'react';
import { Button, Grid, IconButton, Drawer, Box } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import CloseIcon from '@mui/icons-material/Close';
import logo from '../../assets/logo1.png';
import message from '../../assets/contact.png';
import { Link } from 'react-scroll';

const Navbar = () => {
    const [mobileOpen, setMobileOpen] = useState(false);

    const links = [
        { label: "Home", to: "home" },
        { label: "About", to: "about" },
        { label: "Experience", to: "Experience" },
        { label: "Projects", to: "Projects" },
    ];

    return (
        <Box sx={{ background: "rgb(30,30,30)", color: "white", position: "sticky", top: 0, zIndex: 1300 }}>
            <Grid container alignItems="center" justifyContent="space-between" py="20px" px={{ md: "70px", xs: "15px" }}>

                {/* Left Logo */}
                <Grid item>
                    <img src={logo} alt="logo" style={{ height: '55px', cursor: 'pointer' }} />
                </Grid>

                {/* Desktop Nav Links */}
                <Grid item sx={{ display: { xs: 'none', md: 'flex' }, gap: 3 }}>
                    {links.map((link) => (
                        <Link key={link.to} to={link.to} smooth duration={500}>
                            <Button
                                sx={{
                                    color: 'white',
                                    textTransform: 'none',
                                    fontWeight: 'bold',
                                    fontSize: 'large',
                                    '&:hover': { color: 'yellow' }
                                }}
                            >
                                {link.label}
                            </Button>
                        </Link>
                    ))}
                </Grid>

                {/* Contact Button Desktop */}
                <Grid item sx={{ display: { xs: 'none', md: 'flex' } }}>
                    <Button
                        variant="contained"
                        sx={{
                            background: 'white',
                            color: 'black',
                            fontWeight: 'bold',
                            display: 'flex',
                            alignItems: 'center',
                            gap: 1,
                            textTransform: 'none'
                        }}
                    >
                        <img src={message} alt="message" style={{ width: 20, height: 20 }} />
                        Contact Me
                    </Button>
                </Grid>

                {/* Mobile Menu Icon */}
                <Grid item sx={{ display: { xs: 'flex', md: 'none' } }}>
                    <IconButton onClick={() => setMobileOpen(true)} sx={{ color: "white" }}>
                        <MenuIcon />
                    </IconButton>
                </Grid>
            </Grid>

            {/* Mobile Drawer */}
            <Drawer
                anchor="right"
                open={mobileOpen}
                onClose={() => setMobileOpen(false)}
                PaperProps={{
                    sx: { width: 250, backgroundColor: "rgb(30,30,30)", color: "white" }
                }}
            >
                <IconButton onClick={() => setMobileOpen(false)} sx={{ color: "white", alignSelf: "flex-end" }}>
                    <CloseIcon />
                </IconButton>

                {links.map((link) => (
                    <Link key={link.to} to={link.to} smooth duration={500}>
                        <Button
                            sx={{
                                color: 'white',
                                textTransform: 'none',
                                fontWeight: 'bold',
                                width: '100%',
                                justifyContent: 'flex-start',
                                padding: '10px 16px'
                            }}
                            onClick={() => setMobileOpen(false)}
                        >
                            {link.label}
                        </Button>
                    </Link>
                ))}

                <Button
                    variant="contained"
                    sx={{
                        background: 'white',
                        color: 'black',
                        fontWeight: 'bold',
                        display: 'flex',
                        alignItems: 'center',
                        gap: 1,
                        textTransform: 'none',
                        width: "90%",
                        m: 2
                    }}
                >
                    <img src={message} alt="message" style={{ width: 20, height: 20 }} />
                    Contact Now
                </Button>
            </Drawer>
        </Box>
    );
};

export default Navbar;
